import * as actionTypes from './actions';

const initialState = {
    products: null
}

const reducer = (state = initialState, action) => {
    switch (action.type) {
        case actionTypes.INIT_PRODUCTS:
            console.log(action.productsArr)
            return {
                ...state,
                products: action.productsArr
            }
    }
    return state;
}

export default reducer;
